# bubbleSort


def bubbleSort(arreglo):

    n = len(arreglo)
    for i in reversed(range(1, n)): #de n-1 hasta 1
        for j in range(i):  
            if arreglo[j] > arreglo[j + 1]: 

                temp = arreglo[j + 1]
                arreglo[j + 1] = arreglo[j]
                arreglo[j] = temp

    return arreglo



